<?php
class Solution {

    /**
     * @param String $num
     * @param Integer $k
     * @return String
     */
    function removeKdigits($num, $k) {
        $stack = [];
        $len = strlen($num);
        for ($i = 0; $i < $len; $i++) {
            $n = $num[$i];
            while ($k > 0 && !empty($stack) && end($stack) > $n) {
                array_pop($stack);
                $k--;
            }
            array_push($stack, $n);
        }
        while ($k > 0) {
            array_pop($stack);
            $k--;
        }
        $res = implode("", $stack);
        $res = ltrim($res, "0");
        return $res == "" ? "0" : $res;
    }
}

$solution = new Solution();
